import Link from 'next/link'

import styles from './menu.module.scss'

const Header = () => (
     <header className={styles.HeaderContainer}>
         <div>A</div>
         <div>B</div>
         <div>C</div>
         <div>D</div>
         <div>E</div>
         <div>F</div>
         <div>G</div>
         <div>H</div>
         <div>I</div>
         <div>J</div>
         <div>
             {/* LOGO */}
             <Link href="/" as={`/`}>
                 <h1 className={styles.H1Container}>Yum Tash</h1>
            </Link>
        </div>
         <div>L</div>
         <div>M</div>
         <div>N</div>
         <div>P</div>
         <div>Q</div>
         <div>R</div>
         <div>S</div>
         <div>T</div>
         <div>U</div>
         <div>V</div>
         <div>W</div>
         <div>

                <Link href="/anmeldelser" as="{`/anmeldelser`}">
                    <h3 className={styles.Anmeldelser}>
                        Anmeldelser
                    </h3>
                </Link>

         </div>
         <div className={styles.dropdown}>
            <Link href="/oppskrifter" as="{`/oppskrifter`}">
                <h3 className={styles.MenuItemContainer}>
                    Oppskrifter &#x21A1;
                </h3>
            </Link>
            <div className={styles.dropdownContent}>
                    <p className={styles.dropDownItems}>
                        Middag
                    </p>
                    <p className={styles.dropDownItems}>
                        Klassikere
                    </p>
                    <p className={styles.dropDownItems}>
                        Grillmat
                    </p>
                    <p className={styles.dropDownItems}>
                        Desserter
                    </p>
                    <p className={styles.dropDownItems}>
                        Gjeste Middager
                    </p>
                    <Link href="/signatur" as="{`/signatur`}">
                        <p>
                            Signatur Retter
                        </p>
                    </Link>
                </div>
         </div>
         <div>3</div>
         <div>4</div>
         <div>5</div>
         <div>6</div>
     </header>
);

export default Header


